import React from "react";
import { Link } from "react-router-dom";

export default [
  {
    path: "/",
    name: "Home",
    Component: "Home",
  },
  {
    path: "/decks/:deckId",
    name: "Deck",
    Component: "Deck",
  },
  {
    path: "/decks/new",
    name: "Create Deck",
    Component: "CreateDeck",
  },
  {
    path: "/decks/:deckId/study",
    name: "Study",
    Component: "Study",
  },
  {
    path: "/decks/:deckId/edit",
    name: "Edit Deck",
    Component: "EditDeck",
  },
  {
    path: "/decks/:deckId/cards/new",
    name: "Add Card",
    Component: "AddCard",
  },
  {
    path: "/decks/:deckId/cards/:cardId/edit",
    name: "Edit Card",
    Component: "EditCard",
  },
];
